import React from 'react'

const WikiSearch = () => {
    return (
        <div className="m-20">
            <div className='ui form'>
                <div className='field'>
                    <label><span className='color-yellow'></span>Enter Search Term</label>
                    <input className='input'/>
                </div>
            </div>
        </div>
    )
};

export default WikiSearch;
